script: |
  super -f text -I q5340.spq | sort > q5340.out

inputs:
  - name: q5340.spq
    data: |
      SELECT ALL - + col0 + - + col2 * + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN + + col0 + - col2 - + col2 + col0 + - col2 + col1 AND NULL;
  - name: tab1

outputs:
  - name: q5340.out
    data: |
